import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./Sdata";


function ncard(value) {
    return (
        <Cards
            imgsrc={value.imgsrc}
            title={value.title}
            link={value.link}
            seriesname={value.seriesName}
        />
    )
}

ReactDOM.render(

    Sdata.map(ncard)
    , document.getElementById('root')
)
